import {
  observer
} from "mobx-react";

class ElementaryList extends Component {

  handleClick = () => {
    alert(`Hello`);
  };
  render(props) {
    const category = props.category;

    // if (!authStore.user) return <Redirect to="/login" />;
    return (
      // <Card button onClick={this.handleClick}>
      //   <Card.Body>{category.name}</Card.Body>
      // </Card>
      <
      Card style = {
        {
          width: "18rem"
